////// LAZY LINE INIT

$(document).ready(function ($){
    (function() {

        document.onreadystatechange = function() {

            if (document.readyState === 'complete') {
                var elements = [{
                    icon: document.querySelector('#service-1'),
                    paint: document.getElementById('service-1'),
                    config: {
                        strokeCap:'round',
                        strokeOpacity: 1,
                        strokeWidth: 0.366,
                        ease: 'easeLinear',
                    	delay: 0,
                        drawSequential: true
                    }
                },
                {
                    icon: document.querySelector('#service-2'),
                    paint: document.getElementById('service-2'),
                    config: {
                        strokeCap:'square',
                        strokeOpacity: 1,
                        strokeWidth: 0.899,
                        ease: 'easeLinear'
                    }
                },
                {
                    icon: document.querySelector('#service-3'),
                    paint: document.getElementById('service-3'),
                    config: {
                        strokeCap:'square',
                        strokeOpacity: 1,
                        strokeWidth: 1.542,
                        ease: 'easeLinear'
                    }
                },
                {
                    icon: document.querySelector('#service-4'),
                    paint: document.getElementById('service-4'),
                    config: {
                        strokeCap:'square',
                        strokeOpacity: 1,
                        strokeWidth: 5.322,
                        ease: 'easeLinear'
                    }
                },
                {
                    icon: document.querySelector('#service-5'),
                    paint: document.getElementById('service-5'),
                    config: {
                        strokeCap:'square',
                        strokeOpacity: 1,
                        strokeWidth: 0.752,
                        ease: 'easeLinear'
                    }
                },
                {
                    icon: document.querySelector('#service-6'),
                    paint: document.getElementById('service-6'),
                    config: {
                        strokeCap:'square',
                        strokeOpacity: 1,
                        strokeWidth: 0.438,
                        ease: 'easeLinear'
                    }
                }];

                elements.forEach(function(item){
                    item.handler = new function(item) {
                        var that = this;

                        this.item = item;
                        this.animation;

                        this.init = function(){ 
                            this.animation = new LazyLinePainter(that.item.icon, that.item.config);
                            this.animation.paint();
                        };

                        that.init();

                    	var title = that.item.icon.id;

                        $('[data-title="' + title + '"]').on('mouseenter', function(){
                        	that.update('paint');
                        });

                        this.update = function (){
                            if ($(that.item.paint).hasClass('inactive')) 
                                return;
                            that.init();
                        }

                    }(item);

                }, this);
            }
        }
    })();

});
